import React from 'react'
import "./Support.css"
import {SupportBaseType} from '../../../SignworksJSON'

export default function Support(props) {
  //console.log('props', props)
  console.log(SupportBaseType)
  return (
    
    <div className="Support">
         <p> {console.log("sbt", SupportBaseType)}
        { props.sel?SupportBaseType.name(props.sel.attributes.SUPPORTTYPE):'null '}
         </p>
    </div>
  )
}
